import React from 'react'
import './HeroSection.css'
import PlaceholderVideo from '../resources/videos/PlaceholderVideo.mp4';

function HeroSection() {
    return (
        <div className='hero-container'>
            <video src={PlaceholderVideo} autoPlay loop muted />
            <h1><span class='highlight'>WHERE STUFF HAPPENS</span></h1>
            <p><span class='highlight'>What are you waiting for?</span></p>
        </div>
    )
}
export default HeroSection
